import React, { useState } from "react";
import { Form, Input } from "antd";

const LoginForm = () => {
    const [id, setId] = useState("");
    const [password, setPassword] = useState("");
    return (
        <Form>
            <div>
                <label hmtlFor="user-id">아이디</label>
                <br />
                <Input type="text" name="user-id" value={id}></Input>
            </div>
            <div>
                <label hmtlFor="user-password">비밀번호</label>
                <br />
                <Input
                    type="text"
                    name="user-password"
                    type="password"
                    value={password}
                ></Input>
            </div>
        </Form>
    );
};

export default LoginForm;
